import React from 'react'
import {NavLink} from 'react-router-dom'
import s from './Header.module.css'

function Header() {
    const onClickHandler = (event: React.MouseEvent<HTMLAnchorElement, MouseEvent>) => {
        console.log(event.currentTarget.nodeValue)
      return event.currentTarget ? s.activ : ''
    }
    return (
        <div className={s.wrapper}>
            <div className={s.navBox}>
                {/*// add NavLinks*/}
                <NavLink to={'/'} className={`${s.navLinck} ${()=>onClickHandler()}` } onClick={(event)=>onClickHandler('activ')}>pre-junior</NavLink>
                <NavLink to={'/zalupa'} className={`${s.navLinck} ${onClickHandler}` } onClick={(event)=>onClickHandler(event)}>junior</NavLink>
                <NavLink to={'/zalupa+'} className={`${s.navLinck} ${onClickHandler}` } onClick={(event)=>onClickHandler(event)}>junior+</NavLink>
                <div className={s.navLinckBtn}>x</div>
            </div>
        </div>
    )
}

export default Header
